🙄Bien sea que trabajes con personajes o solo elementos, hay mucho que pensar: 

Técnica, estilo, colores, cómo aparecen en escena, cómo se comportan, qué intención tienen, qué ejemplifican, y un sin fin de componentes a considerar. 

😵La animación es un trabajo que implica mucho tiempo y esfuerzo sea cual sea la técnica que se aplique, pero es de las cosas que más satisfacción me dan al ver el resultado.🥳

Yo tengo mucho por aprender en esta área, pero le tengo un gran cariño...Desde mucho antes de que en la universidad a @nilzitazip y a mí se nos ocurriera la loca idea de hacer un corto en Stop Motion sin tener idea del lío en que nos estábamos metiendo. (Ver foto) 😂🤣😅

Algunas veces diseño yo, y otras dependiendo del estilo, acudo a otros diseñadores e ilustradores que me han permitido darle vida a sus creaciones. 
. 
